for name, string in raw_str.items():
    item = dict()
    item["name"] = name
    item["string"] = string
    lineup.append(item)


def compare(s1, s2):
    def get_weight(s: dict) -> int:
        #    场地 1000000000000
        # 2F 春哥 10000000000
        # 2A 曾哥 100000000
        # 1E 南瓜 1000000
        # 10 睡莲 10000
        # 21 花盆 100
        # 30 梯子 1
        w = 0
        items = s["string"].split(",")
        for i in range(len(items)):
            if i == 0:
                scene = items[0]
                if scene == "0":  # pool
                    w += 2 * 1000000000000
                elif scene == "1":  # fog
                    w += 3 * 1000000000000
                elif scene == "2":  # day
                    w += 0 * 1000000000000
                elif scene == "3":  # night
                    w += 1 * 1000000000000
                elif scene == "4":  # roof
                    w += 4 * 1000000000000
                elif scene == "5":  # moon
                    w += 5 * 1000000000000
            else:
                plant = items[i].split(" ")[0]
                if plant == "2F":  # Cob Cannon
                    w += 10000000000
                elif plant == "2A":  # Gloom-shroom
                    w += 100000000
                elif plant == "1E":
                    w += 1000000
                elif plant == "10":
                    w += 10000
                elif plant == "21":
                    w += 100
                elif plant == "30":
                    w += 1
        return w
    w_s1 = get_weight(s1)
    w_s2 = get_weight(s2)
    if w_s1 < w_s2:
        return -1
    elif w_s1 > w_s2:
        return 1
    else:
        return 0


lineup_sorted = sorted(lineup, key=functools.cmp_to_key(compare))

